import * as api from '../api/index.js';

export const register = (sellerInfo,router) =>  (dispatch) => {
    try {
         api.registerSeller(sellerInfo)
         .then(result =>{

            dispatch({type: 'REGISTER', payload: result});
         })

        //router.push('/customer');
    } catch (error) {
        console.log(error);
    }
};
